import React from "react";
import { VictoryPie } from "victory";
import './StylePie.css';

const PieChart = () => {
  return (
    <div className="pie-chart">
      <VictoryPie
        style={{ labels: { fill: "white" } }}
        innerRadius={100}
        data={[
          { "name":"IOS", "percent":80 },
          { "name":"Android", "percent":20 }
        ]}
      />
    </div>
  );
};
export default PieChart;
